import ExpenseItem from "./components/ExpenseItem";

function App() {
  const expenses = [
    { title: "Car Insurance", amount: 100, date: new Date()(2021, 5, 4) },
    { title: "Health Insurance", amount: 200, date: new Date()(2021, 5, 4) },
    {
      title: "Retirement Insurance",
      amount: 200,
      date: new Date()(2021, 5, 4),
    },
    { title: "Financial Insurance", amount: 500, date: new Date()(2021, 5, 4) },
  ];
  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem />
    </div>
  );
}

export default App;
